import React from 'react'
import './App.css'
import Todos from './todos/Todos'


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Reactors</h1>

        {todos.map((todo, index) => (
          <Todo
            key={index}
            index={index}
            todo={todo}
          />
        ))}
      </header>
    </div>
  );
}

export default App;
